// Define the list of featured recipes (sample recipes added)
const featuredRecipes = [
    { name: "Mango Chicken", image: "path/to/mango-chicken.jpg", recipe: "A delicious tangy mango chicken recipe with a mix of sweet and spicy flavors." },
    { name: "Vegetable Stir Fry", image: "path/to/veg-stir-fry.jpg", recipe: "A healthy and colorful vegetable stir-fry with a variety of fresh vegetables." },
    { name: "Spaghetti Carbonara", image: "path/to/spaghetti-carbonara.jpg", recipe: "Classic Italian pasta with creamy sauce, bacon, and parmesan." },
    { name: "Tacos", image: "path/to/tacos.jpg", recipe: "Mexican tacos with seasoned meat, topped with fresh salsa, and cheese." },
    { name: "Paneer Tikka", image: "path/to/paneer-tikka.jpg", recipe: "Indian paneer grilled with spices and served with green chutney." },
    { name: "Cheese Pizza", image: "path/to/cheese-pizza.jpg", recipe: "A classic cheese pizza with gooey mozzarella and a crispy crust." }
];

// Current page and category tracking
let currentCuisine = window.location.pathname.split('/').pop().replace('.html', '');
let currentCategory = 'breakfast';
let currentIndex = 0;

// Initialize the page
document.addEventListener('DOMContentLoaded', function() {
    initializeSearch();
    initializeModal();
    if (currentCuisine === 'main') {
        initializeCarousel();
    }
    initializeDishCards();
});

// Search functionality
function initializeSearch() {
    const searchInput = document.getElementById('tsearch2');
    searchInput.addEventListener('input', function(e) {
        const searchTerm = e.target.value.toLowerCase();
        searchRecipes(searchTerm);
    });
}

function searchRecipes(searchTerm) {
    const allDishCards = document.querySelectorAll('.dish-card');
    allDishCards.forEach(card => {
        const dishName = card.querySelector('.dish-name').textContent.toLowerCase();
        const category = card.closest('.meal-section')?.querySelector('h2')?.textContent.toLowerCase() || '';
        const shouldShow = dishName.includes(searchTerm) || category.includes(searchTerm);
        card.style.display = shouldShow ? 'block' : 'none';
    });
}

// Modal functionality
function initializeModal() {
    const modal = document.getElementById('recipe-modal');
    const closeBtn = document.querySelector('.close');
    const prevBtn = document.querySelector('.modal-nav.prev');
    const nextBtn = document.querySelector('.modal-nav.next');

    closeBtn.onclick = closeModal;
    window.onclick = (event) => {
        if (event.target === modal) closeModal();
    };

    prevBtn.onclick = showPreviousRecipe;
    nextBtn.onclick = showNextRecipe;

    // Add keyboard navigation
    document.addEventListener('keydown', (e) => {
        if (modal.style.display === 'block') {
            if (e.key === 'ArrowLeft') showPreviousRecipe();
            if (e.key === 'ArrowRight') showNextRecipe();
            if (e.key === 'Escape') closeModal();
        }
    });
}

function initializeDishCards() {
    const dishCards = document.querySelectorAll('.dish-card');
    dishCards.forEach((card, index) => {
        card.addEventListener('click', () => {
            currentIndex = index;
            showRecipeModal(index);
        });
    });
}

function showRecipeModal(index) {
    const modal = document.getElementById('recipe-modal');
    const recipeDetails = document.querySelector('.recipe-details');
    const currentRecipe = getCurrentRecipeData(index);

    if (currentRecipe) {
        recipeDetails.innerHTML = `
            <h2>${currentRecipe.name}</h2>
            <img src="${currentRecipe.image}" alt="${currentRecipe.name}">
            <p>${currentRecipe.recipe}</p>
        `;
        modal.style.display = 'block';
    }
}

function getCurrentRecipeData(index) {
    const category = getCurrentCategory(index);
    const recipes = getRecipesForCurrentPage();
    return recipes[category][index % 6];
}

function getCurrentCategory(index) {
    if (index < 6) return 'breakfast';
    if (index < 12) return 'lunch';
    return 'dinner';
}

function getRecipesForCurrentPage() {
    return recipes[currentCuisine] || recipes.indian; // Default to Indian if not found
}

function showPreviousRecipe() {
    currentIndex = (currentIndex - 1 + 18) % 18; // 18 is total number of recipes (6 * 3 categories)
    showRecipeModal(currentIndex);
}

function showNextRecipe() {
    currentIndex = (currentIndex + 1) % 18;
    showRecipeModal(currentIndex);
}

function closeModal() {
    document.getElementById('recipe-modal').style.display = 'none';
}

// Carousel functionality for main page
function initializeCarousel() {
    if (!document.querySelector('.featured-carousel')) return;
    
    const carousel = document.querySelector('.featured-carousel');
    const prevButton = document.querySelector('.carousel-button.prev');
    const nextButton = document.querySelector('.carousel-button.next');
    let currentSlide = 0;

    prevButton.addEventListener('click', () => {
        currentSlide = (currentSlide - 1 + featuredRecipes.length) % featuredRecipes.length;
        updateCarousel();
    });

    nextButton.addEventListener('click', () => {
        currentSlide = (currentSlide + 1) % featuredRecipes.length;
        updateCarousel();
    });

    // Auto-scroll every 5 seconds
    setInterval(() => {
        currentSlide = (currentSlide + 1) % featuredRecipes.length;
        updateCarousel();
    }, 5000);

    // Initial display
    updateCarousel();
}

function updateCarousel() {
    const carousel = document.querySelector('.featured-recipes-carousel');
    if (!carousel) return;
    
    const currentRecipe = featuredRecipes[currentSlide];
    carousel.innerHTML = `
        <div class="dish-card">
            <img src="${currentRecipe.image}" alt="${currentRecipe.name}" class="dish-image">
            <div class="dish-name">${currentRecipe.name}</div>
        </div>
    `;
}
